import React, { Component } from 'react';
import TOC from "./components/TOC";
import Content from "./components/Contents";
import Subject from "./components/Subject";
import './App.css';

// 최신 자바스크립트는 클래스 안에 속하는 function은 function을 생략 원래 function render이나 생략
// 하나의 최상위 태그만 써야된다 !
// attibute == props



class App extends Component{
  // 컴포넌트 초기화시켜주고 싶은 코드를 여기다 집어넣음
  constructor(props){
    super(props);
    this.state = {
      subject:{title:"WEB" , sub:"world Wid Web!"}
    }
  }
  render() {
  return (
    <div className="App">
      <Subject title={this.state.subject.title} sub="world wird web;"></Subject>
      <Subject title="TEST" sub="User Interface"></Subject>
      <TOC></TOC>
      <Content title="HTML" desc="HTML is HyperText Markup Language."></Content>
    </div>
    );
  }
}
export default App;
